import React, {FC} from 'react';

export interface ToeProps {
    index?: number
}

const Toe: FC<ToeProps> = ({index}) => {
    return (
        <div style={{
            border:'1px solid black',
            display:'flex',
            backgroundColor:'lightgray',
            width:'90px',
            height:'90px',
            alignSelf:'center',
            verticalAlign:'baseline',
            flexFlow:'row wrap',
            flexWrap:'wrap'
        }}
        >
            <h1>{index}</h1>
        </div>
    );
};

export default Toe;
